import friend from './Friends.module.css';
import navbar from "../Nav.module.css";
import {NavLink} from "react-router-dom";

function FriendList(props) {
    return (
        <div className={navbar.friend_list}>
            <NavLink to={'/'}>Friends</NavLink>
            <div className={friend.friend_item}>
                <span className={friend.friend_item_name}> {props.stateFriends.friendData} </span>
            </div>
        </div>
    );
}
